import { Navbar } from "../components";

const Upload = () => {
    return (
        <div className="w-full bg-gray-100 min-h-screen">
            <Navbar/>
            <div className="w-[50vw] py-5 mt-10 px-5 mx-auto bg-white rounded-lg">
                <label className="bg-gray-100 rounded-lg w-[48%] h-[200px] flex justify-center items-center"></label>
            </div>
        </div>
    )
}

export default Upload;
